import React from 'react'
import styled from 'styled-components';
import Menubar from './Menubar';

function About() {
    return (
        <>
            <div><Menubar /></div>
            <div>
                About
            </div>
        </>
    )
}
const Div = styled.div`
    text-align: center;
`;
export default About
